import MachinesIcon from "../images/dumbbell.png";
import PersonalTrainerIcon from "../images/personal.png";
import MembershipIcon from "../images/membership.png";
import CountUp from 'react-countup';
import { Trainers, gyminfo } from "./Data";
import { useEffect, useState } from "react";


const GymInfos = (props) => {


    const [details, setDetails] = useState([])

    useEffect(() => {
        if (props.type === "gym") {
            setDetails(gyminfo)
        }
    })


    return (
        <div className="three-gym-info">
            {details.map((data) => {
                return (
                    <div className="gym-info" id={data.id}>
                        <div className="info-holders">
                            <img className="info-icon" src={data.icon} />
                        </div>
                        <div className="info-holders">
                            <CountUp start={data.start} end={data.no} delay={0} duration={2} enableScrollSpy>
                                {({ countUpRef }) => (
                                    <div>
                                        <span className="info-number" ref={countUpRef} /><br />
                                    </div>
                                )}
                            </CountUp>

                            <span className="info-desc">{toUpperCase(data.title)}</span>
                        </div>
                    </div>
                )
            })}
        </div>
    )

}

export default GymInfos;
